.form-control {
  --form-control-padding-y: var(--space-xxs);
  --form-control-padding-x: var(--space-xs);
  --form-control-radius: 0.25em;
  --form-control-font-size: 1em;
  line-height: 1.2;
  background-color: var(--color-bg);
  border: 2px solid var(--color-contrast-low);
  transition: .2s;
}

.form-control::placeholder {
  opacity: 1;
  color: var(--color-contrast-medium);
}

.form-control:focus {
  outline: none;
  border-color: var(--color-primary);
  box-shadow: 0 0 0 2px hsla(var(--color-primary-h), var(--color-primary-s), var(--color-primary-l), 0.2);
}

.form-control--error,
.form-control[aria-invalid="true"] {
  border-color: var(--color-error);
}

.form-control--error:focus,
.form-control[aria-invalid="true"]:focus {
  box-shadow: 0 0 0 2px hsla(var(--color-error-h), var(--color-error-s), var(--color-error-l), 0.2);
}

.form-control--disabled,
.form-control[disabled],
.form-control[readonly] {
  cursor: not-allowed;
}

.count-todo {
  position: sticky;
  top: 50px;
}

.count-todo__title {
  display: block;
  width: 100%;
  text-align: center;
  font-size: 3rem;
}

.count-todo__title small {
  display: block;
  font-size: 1.3rem;
  font-weight: 400;
  color: var(--text-secondary);
}

.count-todo__title > * + * {
  margin-top: 0.4rem;
}

.todos .no-items {
  margin-top: 1rem;
}

.todos__items {
  list-style: none;
  padding: 0;
  margin: 1rem 0 0 0;
  font-weight: 300;
}

.todos__item {
  position: relative;
  padding: 0 0 0 2rem;
  font-size: 1.3rem;
  margin-bottom: 1.3rem;
}

.todos__item::before {
  content: "🎉";
  position: absolute;
  top: 1px;
  left: 0;
}

.todos__item:last-child {
  margin-bottom: 0;
}

.todos__button--delete {
  background: transparent;
  border: none;
  position: relative;
  color: var(--danger);
  font-weight: 500;
  font-size: 1rem;
  margin: 0 0 0 5px;
  padding: 0 5px;
  cursor: pointer;
}

.todos__form {
  margin: 2rem 0 0 0;
  padding: 1rem 0 0 0;
  border-top: 1px dotted var(--border);
  font-size: 1rem;
  color: #141414;
  border-color: #ccc;
}

.todos__form-label {
  cursor: pointer;
  font-size: 1.1rem;
  font-weight: 400;
  display: block;
}

.todos__form-actions {
  display: flex;
  align-items: center;
  margin-top: 0.5rem;
}

.todos__form-input {
  margin: 0;
  display: inline-block;
  vertical-align: middle;
  line-height: 1.1;
  background: #fff;
  border: 1px solid #ccc;
  padding: 11px 15px 10px 15px;
  border-radius: 2px;
  font-size: 1rem;
}

.todos__form-button {
  display: inline-block;
  border: 0;
  margin-left: 0.4rem;
  text-decoration: none;
  background: #666;
  color: #fff;
  padding: 11px 25px 10px 25px;
  font-family: sans-serif;
  font-size: 1rem;
  border-radius: 2px;
  cursor: pointer;
  text-align: center;
}

:root {
  --background-body: #95a5a6;
  --border: #888888;
  --decor: #777777;
  --text: #333333;
  --text-secondary: #555555;
  --danger: #d62c1a;
  --danger--dark: #a82315;
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

*::after,
*::before {
  box-sizing: border-box;
}

html,
body {
  font-family: 'Open Sans', sans-serif;
  font-size: 16px;
  font-weight: 400;
  color: var(--text);
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

h1,
h2 {
  font-weight: 400;
}

.yem-index-page {
  background-color: #f3f3f3;
}

main {
  padding-top: 2rem;
  padding-bottom: 2rem;
}

.container {
  margin-right: auto;
  margin-left: auto;
  width: 100%;
  padding-left: 1rem;
  padding-right: 1rem;
}

@media screen and (min-width: 40em) {
  .container {
    width: 80vw;
    max-width: 40em;
  }
}

.app__inner {
  display: grid;
  grid-template-columns: 1fr;
  grid-auto-flow: row;
  grid-gap: 2rem;
}

@media screen and (min-width: 40rem) {
  .app__inner {
    grid-template-columns: 2fr 1fr;
  }
}

.visually-hidden {
  display: block;
  height: 1px;
  width: 1px;
  overflow: hidden;
  clip: rect(1px 1px 1px 1px);
  clip: rect(1px, 1px, 1px, 1px);
  clip-path: inset(1px);
  white-space: nowrap;
  position: absolute;
}
